import * as React from 'react';
import Button from "@mui/material/Button";
import Grid from "@mui/material/Grid";
import ShiftsDataGrid from "./ShiftsDataGrid";

export default function ShiftsListingPage() {
  return (
    <div>
      <Grid container spacing={2}>
      </Grid>  
      <Button variant="outlined">Set Shift Assignment</Button>
      <ShiftsDataGrid></ShiftsDataGrid>
    </div>
  );
}
